MAGICLICK.Modules.moduleContact = (function ($) {
    var module = function (el, id) {
        var _self;
        var properties = {
            "el": el,
            "ID": id,
            "name": "letiim Formu"
        };

        MAGICLICK.Modules.__module.call(this, properties);
        this.init();
    };

    module.prototype = Object.create(MAGICLICK.Modules.__module.prototype);

    $.extend(module.prototype, {
        init: function () {
            _self = this;
            this.moduleCache();
            this.eventListener();
        },
        moduleCache: function () {
            this.elements.$radioBtn = this.elements.$el.find('.radio-container span');
            this.elements.$sendBtn = this.elements.$el.find(".contact-form .send-btn");
            this.elements.$formWrapper = this.elements.$el.find(".form-wrapper");
            this.elements.$contactForm = this.elements.$el.find(".contact-form");
            this.elements.$captchaWrap = this.elements.$el.find('.captcha-wrap');
            this.elements.$addFile = this.elements.$el.find('#file');
        },
        result: function () {

            var form = new FormData();


            form.append("FullName", $('#fullname').val());
            form.append("Email", $('#email').val());
            form.append("Phone", $('#gsm').val().replace(/\ /g, '').replace(')', '').replace('(', ''));
            form.append("IdentificationNumber", $('#tckn').val());
            form.append("CategoryID", $('#ddlCategory').find('option:selected').val());
            form.append("Message", $('#notes').val());
            form.append("Kvkk", $('#kvkk').is(':checked') != true ? false : true);
            form.append("Captcha", $('#txtCaptcha').val());
            form.append("ContactOption", $('#email-contact').is(':checked') == true ? "E-Posta" : "Telefon");
            form.append("ChannelId", $('#ddlChannel').val());
            for (var i = $("input[type='file']").length - 1; i > 0; i--) {
                var files = $("input[type='file']")[i].files[0];
                if (typeof files != 'undefined') {
                    form.append('File', files);
                }
            }
            $.ajax({
                method: "POST",
                url: "/api/contactform",
                data: form,
                dataType: "json",
                mimeType: "multipart/form-data",
                contentType: false,
                processData: false,
                timeout: 0,
                headers: {
                    'X-Bone-Language': language == "en" ? "EN" : "TR"
                },
            }).done(function (data) {
                var resultTemplate = _.template($("script.resultTemplate").html());
                _self.elements.$contactForm.html(resultTemplate(data));

            }).fail(function (data) {
                _self.elements.$sendBtn.removeClass('disabled');
                if (data.status == 400) {
                    $('#old-password em').after('<label class="error password-error">Yanl ifre</label>');

                    for (var i = 0; i < data.responseJSON.Message.length; i++) {
                        var message = data.responseJSON.Message[i];
                        if (message.PropertyName == "Email") {
                            $('#email').parents('.form-group').addClass('error');
                            $('.tab-pane:visible #email').after('<label class="error message">' + message.ErrorMessage + '</label>');
                        }
                        if (message.PropertyName == "IdentificationNumber") {
                            $('#tckn').parents('.form-group').addClass('error');
                            $('.tab-pane:visible #tckn').after('<label class="error message">' + message.ErrorMessage + '</label>');
                        }
                        if (message.PropertyName == "CaptchaValidatorModel") {
                            $('#captcha').parents('.form-group').addClass('error');
                            $('#captcha').after('<label class="error message">' + message.ErrorMessage + '</label>');
                            $('.captcha-wrap').find('label').remove();
                            $('.captcha-wrap').after('<label class="error captcha-error message">' + message.ErrorMessage + '</label>');
                        }
                        if (message.PropertyName == "File") {
                            $('.file-exp').addClass("error")
                        }

                        $('html, body').animate({
                            scrollTop: $('.form-wrapper .form-group.error:first').offset().top - 30
                        });

                    }

                    captchaRefresh(_self.elements.$captchaWrap.find('img'));

                }

                if (data.status == 500 || data.status == 404 || data.status == 403) {
                    var formResultTemplate = _.template($("script.formErrorTemplate").html());
                    _self.elements.$contactForm.html(formResultTemplate);
                }

            });

        },
        eventListener: function () {
            _self.elements.$sendBtn.on('click', function () {
                if (!$("#aspnetForm").valid()) {
                    $('html, body').animate({ scrollTop: $('.form-wrapper').offset().top }, 300);
                    return false;
                } else {
                    _self.result();
                    $(this).addClass('disabled');
                }
            });

            var fileCount = 0;
            var files = [];
            $(document).on('change', "input[type=file]", function () {

                if ($('.file-name >p').length > 4) {
                    return false;
                } else {
                    $('.file-exp').removeClass("error")
                    _self.elements.$sendBtn.removeClass("disabled");
                    var children = "";
                    if (($(this)[0].files[0].size / 1024 / 1024) > 2 || !/image|officedocument/.test($(this)[0].files[0].type)) {
                        $('.file-exp').addClass("error")
                    } else {
                        fileCount += 1;
                        var addFileHtml = '<div class="add-file-item">' +
                            '<div>' +
                            '<label for="file' + fileCount + '" class="file-text">Dosya Ekle</label>' +
                            '</div>' +
                            '<input type="file" id="file' + fileCount + '" class="required" accept=".jpg,.jpeg,.png,.pdf,.tiff,.docx,.xlsx,.xls" />' +
                            '</div>';

                        $('.add-file').prepend(addFileHtml);
                        $('.add-file-item').next().hide();
                        $('.file-name').show();
                        files.push($(this)[0].files)

                        for (let i = 0; i < files.length; i++) {
                            children += '<p>' + files[i][0].name + '</p>';
                        }
                        $('.file-name').html(children)
                    }
                }
            });

            $(document).on('click', '.file-name > p', function () {
                var _this = $(this);
                var deletedIndex = -1;
                var deletedFileName = "";
                files.forEach(function (e, i) {
                    if (e[0].name == _this.text()) {
                        deletedFileName = e[0].name;
                        deletedIndex = i;
                    }

                })
                $('input[type="file"]').each(function () {
                    if ($(this)[0] && $(this)[0].files && $(this)[0].files[0] && $(this)[0].files[0].name == deletedFileName) {
                        $(this).closest(".add-file-item").remove();
                    }
                })
                if (deletedIndex > -1) {
                    files.splice(deletedIndex, 1);
                }
                $(this).remove();
            })
        }
    });



    return module;
})(jQuery);

