// her takip edilmesi gereken a taglarna gtag-follow class eklenecek.
var gtagLabelSearchFilter;
$('.search-gtag-label').on('keyup', function () {
    gtagLabelSearchFilter = $(this).val();
})
$(document).on('click', '.gtag-follow', function () {
    var event = $(this).attr("data-event");
    var action = $(this).attr("data-action");
    var category = $(this).attr("data-category");
    var label = $(this).attr("data-label");
    var url = $(this).attr("data-url");

    // gidilen link isteniyor ise data-label directedPageUrl
    if (label == "directedPageUrl") {
        var href = $(this).attr("href");
        label = window.location.origin + href;
        if (url == "internal") {
            label = href;
        }
        // tam url verilmi ise buras alacak. Kontrol edilecek.
        if (category == "Outbound") {
            label = href;
        }
    }
    // label'a input'a yazlan deer baslr. data-label=searchFilter ve yazlan inputa search-gtag-label class eklenecek.
    if (label == "searchFilter") {
        category = "Interaction";
        label = gtagLabelSearchFilter;
    }
    // tklanan sayfa bal ekilmek istenirse data-label=directedPageTitle, ekilmek istenen title'a ise gtag-title class eklenecek.
    if (label == "directedPageTitle") {
        label = $(this).find(".gtag-title").text();
    }
    // /arastirma-raporlari title and date iin label directedPageTitleAndDate olacak.
    if (label == "directedPageTitleAndDate") {
        var title = $(this).find(".gtag-title").text();
        var date = $(this).find(".gtag-date").text();
        label = title + " - " + date;
    }
    // ana sayfa banner iin label=banner.
    if (label == "banner") {
        $('.main-banner .owl-item').each(function () {
            if ($(this).hasClass("active")) {
                var title = $(this).find(".gtag-title");
                label = title.text();
            }
        });
    }
    // /arastirma-raporlari , /yatirim-danismanligi ye ol iin. Tklamann yapld url'yi alr.
    if (label == "currentPage") {
        label = window.location.href;
    }
    // uygulamalarn linkleri iin data-label = app olacak.
    if (label == "app") {
        label = window.location.href;
        if ($(this).hasClass("ios-btn")) {
            action = "E-Trader App - App Store"
        } else if ($(this).hasClass("google-play-btn")) {
            action = "E-Trader App - Google Play"
        } else {
            action = "E-Trader App - Garanti BBVA"
        }
    }
    if (label == "appfx") {
        label = window.location.href;
        if ($(this).hasClass("ios-btn")) {
            action = "FX-Trader App - App Store"
        } else if ($(this).hasClass("google-play-btn")) {
            action = "FX-Trader App - Google Play"
        } else {
            action = "FX-Trader App - Garanti BBVA"
        }
    }
    // baka bir linkin url'si isteniyor ise istenen url olan <a> tagna gtm-register class eklenecek. data-label ise nextUrl olacak.
    if (label == "nextUrl") {
        var url = $('.gtm-register').attr("href");
        label = window.location.origin + url;
    }


    if (label == "this") {
        label = $(this).text();
    }
   
    var gtagData = {
        'event': event,
        'action': action,
        'category': category,
        'label': label
    };
    dataLayer.push(gtagData);
})
;
